import React, { Component} from 'react';
import { submitRegister } from '../actions/authActions';
import { connect } from 'react-redux';
import { Form, Button } from 'react-bootstrap';

class Register extends Component {

    constructor(props){
        super(props);

        this.updateDetails = this.updateDetails.bind(this);
        this.register = this.register.bind(this);
        this.state = {
            details:{
                name: '',
                username: '',
                password: ''
            }
        };
    }

    updateDetails(event){
        let updateDetails = Object.assign({}, this.state.details);

        updateDetails[event.target.id] = event.target.value;
        this.setState({
            details: updateDetails
        });
    }

    register(){
        const {dispatch} = this.props;
        dispatch(submitRegister(this.state.details));
    }

    render(){
        return (
            <div className="login-style">
                <h1 className="acm-multi-color">Login to your account</h1><br /><br />
                <Form className='form-horizontal'>
                    <Form.Label style={{ color: 'white' }} htmlFor="inputUsername5">Name</Form.Label>
                    <Form.Control
                        type="name"
                        id="inputName5"
                        aria-describedby="nameHelpBlock"
                        className="textbox-background"
                    /> <br /> 
                    <Form.Label style={{ color: 'white' }} htmlFor="inputEmail5">Email</Form.Label>
                    <Form.Control
                        type="email"
                        id="inputEmail5"
                        aria-describedby="emailHelpBlock"
                        className="textbox-background"
                    /> <br /> 
                    <Form.Label style={{ color: 'white' }} htmlFor="inputPassword5">Password</Form.Label>
                    <Form.Control
                        type="password"
                        id="inputPassword5"
                        aria-describedby="passwordHelpBlock"
                        className="textbox-background"
                    />
                    <br />
                    <Button className="acm-multi-color" onClick={this.login}>Sign in</Button>
                    <br /><br />  
                    <div className="container">
                    <div id="appleid-signin" data-color="black" data-border="false" data-type="sign in"></div>
                    </div>
                 </Form>
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {
    }
}

export default connect(mapStateToProps)(Register);
